#!/usr/bin/env python3

from binascii import unhexlify


def m5b(s: bytes):
    key = b"KCQR19TZ"
    result = bytearray()
    for i in range(len(s)):
        result.append(s[i] ^ key[i % len(key)])
    return bytes(result)


def m6a(s: str):
    return unhexlify(s)


def dec(s: str):
    return m5b(m6a(s))


enc1 = ""

print(dec(enc1))
